import "./App.css";
import Attraction from "./pages/attraction";
import Beach from "./pages/beach";
import Resort from "./pages/resort";
import Restaurant from "./pages/restaurant";
import Supermarket from "./pages/supMarket";

// TODO:
// Animation of all the text
// Use flex container for all the route buttons
// Add route pages
// Add style for buttons

function App() {
  return (
    <div className="MainDiv">
      <p>TENUTA SAN TOMMASO</p>
      <div className="Container1">
        <button className="languageBtn">choose language</button>
        <button className="helpBtn">need help?</button>
      </div>
      <div>
        <p>Welcome to our structure</p>
        <p>What do you need today?</p>
      </div>
      <div className="Container2">
          <button>
            <a href="/supMarket">Nearest Supermarket</a>
          </button>
          <button>
            <a to={"/restaurant"}>Restaurants</a>
          </button>
          <button>
            <a to={"/attraction"}>What we can visit ?</a>
          </button>
          <button>
            <a to={"/beach"}>Equipped Beach</a>
          </button>
          <button>
            <a to={"/resort"}>What to do in the resort ?</a>
          </button>
        </div>
    </div>
  );
}

export default App;
